import { Box, Select, Typography } from "@mui/material";

const AlignedBox = styled(Box)((props) => ({
    display:'flex',
    alignItems:'center',
    marginLeft : props.marginL
}));




function Header(){


    document.body.style.margin = '0';

    return(
        <AlignedBox align="">

            <AlignedBox>
                <FontDownloadOutlinedIcon />
                <Typography variant="body2">Notion</Typography>  
                <Button>제품</Button>
